import React from 'react';
import { NavLink } from 'react-router-dom';

const SignedInLinks = () => {
    return (
        <ul className="right">
            <li><NavLink to='/'>Felhasználók</NavLink></li>
            <li><NavLink to='/'>Statisztikák</NavLink></li>
            <li><NavLink to='/'>Jegytípusok</NavLink></li>
            <li><NavLink to='/'>Kilépés</NavLink></li>
        </ul>
    )
}
